A variable stores a value and can be manipulated through its identifier. In Rust, we use let to define variables. let works with pattern matching, but for now we're not going to take advantage of it to keep things simple. Below there's the skeleton of declaration and binding of variables. // Declaration
let <identifier>: <type>; // Declaration with value binding
let <identifier>[: <type>] = <expression>; Rust variables are immutable by default. If you try to change an immutable variable's content, the compiler will complain: // If you try to run it, You'll see that this code doesn't compile.
let x = 5;
x = 10; As our dear compiler suggests, just add mut before the identifier to make the variable mutable. // It'll work this time!
let mut x = 5;
x = 10;
assert_eq!(x, 10); It's important to note that Rust has type inference. This means that it tries to identify undeclared types by using the types of the expressions present in the code. For example: let is_raining = true; It's not necessary to annotate the type. As true is of type bool, is_raining will also be.

